import React, { useEffect, useState } from 'react';
import classes from './CatalogCardElem.module.css';
import { useNavigate, useParams } from 'react-router-dom';
// import ProductPage from '../../Pages/ProductPage/ProductPage';
import {data} from '../../data/data';

type CatalogCardElem = {
    onClick?: () => void
}



export default function CatalogCardElem() {
    const navigate = useNavigate();
    const {id} = useParams();
    const param = id;
    const dataN = (data.filter((elem) => elem.nameLink == param)[0].pages);
    // const titles:string[] = [];
    // const nameLink:string[] = [];
    // const img:string[] = [];
    // for (let i = 0; i < dataN.length; i+=1) {
    //     titles.push(dataN[i].titleProduct);
    //     nameLink.push(dataN[i].nameLinkProduct);
    //     img.push(dataN[i].imgProduct);
    // }
    // dataN.forEach((elem: Page) => {
    //     titles.push(elem.titleProduct);
    //     nameLink.push(elem.nameLinkProduct);
    //     img.push(elem.imgProduct);
    // });
    return (
        <main className={classes.catalog_forklift__container}>
            <h3>{(data.filter((elem) => elem.nameLink == param)[0].title)}</h3>
            <div className={classes.catalog_forklift_cards__container}>
                {dataN.map((el, i)=> {
                    // return <ProductPage key = {id+1} onClick={() => navigate(`/${nameLink[id]}>`)}/>
                    return (
                        <div key = {el.titleProduct} className={classes.catalog_forklift_card} onClick={() => navigate(`/${(data.filter((elem) => elem.nameLink == param)[0].nameLink)}/${el.nameLinkProduct}`)}>
                            <span className={classes.catalog_forklift_card_title}>{el.titleProduct}</span>
                            <img src={el.imgProduct} alt='Погрузчик' className={classes.catalog_forklift_card_img}/>
                            <span className={classes.catalog_forklift_card_text}>{el.description.manufacturer}</span>
                        </div>
                    )
                    // <span key = {el} className={classes.catalog_forklift_card} onClick={() => navigate(`/${(data.filter((elem) => elem.nameLink == param)[0].nameLink)}/${nameLink[i]}>`)}>{el}</span>
                })}
            </div>
        </main>
  );
}
